webpackJsonp([95777024024544],{8476:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Dry Election",date:"02 Nov 2004",slug:"/2004-11-02-dry-election/",tags:"Y2004"},html:'<p>One thing I remember about living in Minnesota is that it was illegal to buy alcohol on election day. <a title="Minnesota DPS: Alcohol Enforcement: Frequently Asked Questions" href="http://www.dps.state.mn.us/alcgamb/alcenf/alcfaq.html#when_open">Nice to see that has changed.</a> Prost. (Old news, I see. The election day liquor ban was lifted in <a title="Sacred Sundays open for business" href="http://www.in-forum.com/specials/century/jan3/week36.html">1991</a>.)</p>'},next:{fields:{title:"Switching to del.icio.us",date:"30 Oct 2004",slug:"/2004-10-30-switching-to-delicious/"}},previous:{fields:{title:"What Really Matters",date:"02 Nov 2004",slug:"/2004-11-02-what-really-matters/"}}},{node:{fields:{title:"Switching to del.icio.us",date:"30 Oct 2004",slug:"/2004-10-30-switching-to-delicious/",tags:"Y2004"},html:'<p><a title="Switching to del.icio.us :: hebig.org/blog" href="http://www.hebig.org/blogs/archives/main/001714.php">hebig.org: Switching to del.icio.us for quick links</a>. An idea good enough to steal, er, I mean, use myself.</p>'},next:{fields:{title:"Lack of Respect",date:"30 Oct 2004",slug:"/2004-10-30-lack-of-respect/"}},previous:{fields:{title:"Dry Election",date:"02 Nov 2004",slug:"/2004-11-02-dry-election/"}}},{node:{fields:{title:"Lack of Respect",date:"30 Oct 2004",slug:"/2004-10-30-lack-of-respect/",tags:"Y2004"},html:'<p>If nothing else, the <a title="The New York Times > International > Bin Laden Takes Responsibility for 9/11 Attacks in New Tape" href="http://www.nytimes.com/2004/10/29/international/30osamaCND.html?ex=1256788800&en=5ff84d6f759ad30b&ei=5090&partner=rssuserland">Bin Laden video</a> shows a lack of respect for the American electoral process. He needed <a title="11 March 2004 Madrid attacks - Wikipedia, the free encyclopedia" href="http://en.wikipedia.org/wiki/March_11_Madrid_bombing">bombs</a> to influence the election in Spain, but thinks a video is all he needs for the US.</p>'},next:{fields:{title:"The Security of Checks and Balances",date:"29 Oct 2004",slug:"/2004-10-29-the-security-of-checks-and-balances/"}},previous:{fields:{title:"Switching to del.icio.us",date:"30 Oct 2004",slug:"/2004-10-30-switching-to-delicious/"}}}],pathPrefix:"",first:!1,last:!1,index:393,pageCount:1101}}}});
